import { Routes, Route } from 'react-router';
import './App.css';
import AuthPage from './components/AuthPage';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Routes>
          <Route path='/aa' element={<AuthPage />} />
        </Routes>
        <AuthPage />
      </header>
    </div>
  );
}

export default App;
